customCSS:
@import url('https://fonts.googleapis.com/css2?family=Roboto&display=swap');

.salesforceIdentityLoginBody2 {
    flex-wrap: wrap;
}
.salesforceIdentityLoginBody2 .cCenterPanel {
    align-self: flex-end;
}
body .salesforceIdentityLoginBody2 .cFooterPanel {
    position: initial;
    margin-top: auto;
}

#footer-outer {
            background-color: #f6f6f6;
        }
        #footer-outer[data-cols="1"][data-disable-copyright="false"] .row {
            padding-top: 55px;
        }
        #footer-outer[data-cols="1"] .col {
            text-align: center;
        }
        #footer-outer[data-cols="1"][data-disable-copyright="false"][data-copyright-line="false"][data-matching-section-color="true"] #copyright {
            padding-top: 30px;
        }
        #footer-outer[data-cols="1"][data-disable-copyright="false"] #copyright {
            padding-bottom: 70px;
        }
        #footer-outer[data-cols="1"] #copyright, #footer-outer #copyright[data-layout="centered"] {
            padding: 45px 0;
        }
        #menu-footermenu {
            text-align: center;
        }
        #menu-footermenu > div {
            display: inline-block;
            margin: 0 15px;
        }
        #menu-footermenu a {
            display: inline-block;
            color: #1d7891;
            font-family: "Oswald", sans-serif;
            letter-spacing: 0.25em;
            font-size: 15px;
            text-decoration: none;
            text-transform: uppercase;
            font-weight: 700;
            padding: 8px 0;
        }
        .social > div {
            display: inline-block;
            margin: 0 10px;
            width: auto;
        }
        #footer-outer #copyright div a, #header-secondary-outer #social div a {
            display: block;
            line-height: 22px;
            height: 24px;
            position: relative;
            transition: all 0.2s linear;
            -webkit-transition: all 0.2s linear;
            background-position: center top;
        }
        #footer-outer[data-cols="1"] #copyright .social div a {
            height: 50px;
        }
        #footer-outer #copyright .widget h4,
        #footer-outer #copyright p {
            color: #212121;
        }
        #footer-outer #copyright .social div a {
            color: #175169;
        }
        #footer-outer #copyright div a:hover i,
        #footer-outer[data-cols="1"] #copyright div a:hover i,
        #footer-outer[data-cols="1"] #copyright div a:hover i:after {
            border-color: #1d7891;
            color: #1d7891;
        }
		#footer-outer[data-cols="1"] #copyright div a i {
            -webkit-transition: all .45s cubic-bezier(0.25, 1, 0.33, 1);
            transition: all .45s cubic-bezier(0.25, 1, 0.33, 1);
            height: 46px;
            width: 46px;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        #footer-outer[data-cols="1"] #copyright div a i:after {
            position: absolute;
            -webkit-transition: all .45s cubic-bezier(0.25, 1, 0.33, 1);
            transition: all .45s cubic-bezier(0.25, 1, 0.33, 1);
            pointer-events: none;
            display: block;
            content: '';
            top: 0;
            left: 0;
            opacity: 0.2;
            border-radius: 50%;
            border: 2px solid #212121;
            height: 46px;
            width: 46px;
        }
        #footer-outer[data-cols="1"] #copyright div a:hover i:after {
            opacity: 1;
        }
        #footer-outer[data-cols="1"] #copyright .col .social > div {
            margin-bottom: 25px;
        }
        .fab:before {
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
            content: " ";
            height: 24px;
            display: block;
            width: 24px;
        }
        .fab.fa-facebook-f:before,
        a:hover .fab.fa-facebook-f:before {
            background-image: url(data:image/svg+xml;base64,);
        }
        .fab.fa-linkedin-in:before,
        a:hover .fab.fa-linkedin-in:before {
            background-image: url(data:image/svg+xml;base64,);
        }
        .fab.fa-youtube:before,
        a:hover .fab.fa-youtube:before {
            background-image: url(data:image/svg+xml;base64,);
        }
        .fab.fa-instagram:before,
        a:hover .fab.fa-instagram:before {
            background-image: url(data:image/svg+xml;base64,);
        }
